import React from "react";
import Navbar from "./components/Navbar";
import Hero from "./components/Hero";
import Discover from "./components/Discover";
import BelowDiscover from "./components/BelowDiscover";

function App() {
  return (
    <div>
      <Navbar />
      <Hero />
      <Discover/>
      <BelowDiscover/>
    </div>
  );
}

export default App;
